import data1 from "./Data/1";
import data2 from "./Data/2";

const Result = () => {
  console.log(data2);
  var indicator = Array(11).fill(0);
  console.log(data1);
  const newArray = data1.sort((a, b) => a[0] - b[0]);
  console.log(newArray);

  const logic = () => {
    var currentMax = 0;
    var index = 0;

    for (let i = 0; i < newArray.length; i++) {
      indicator.fill(0);
      let finalArray = [...newArray];
      finalArray.splice(i, 1);
      console.log(finalArray);

      for (let k = 0; k < finalArray.length; k++) {
        var list = [];
        for (var j = finalArray[k][0]; j < finalArray[k][1]; j++) {
          list.push(j);
          list.forEach((index) => {
            indicator[index] = 1;
          });
        }
      }
      console.log(indicator);
      const count = indicator.filter((x) => x == 1).length;
      console.log(count);
      if (count > currentMax) {
        currentMax = count;
        index = i;
      }
    }
    console.log("max", currentMax);
    console.log("index", index);

    return currentMax;
  };

  return <div>{logic()}</div>;
};

export default Result;
